import styles from './navbar.module.scss';

import Cookies from 'universal-cookie';
const cookies = new Cookies();

function Navbar()   {

    const onLogout = () => {
        cookies.remove('user')
        cookies.remove('pilot')
        cookies.remove('farm')
        cookies.remove('farmer')
    }

    return (
        <div className={styles['navbar']}>
            <div className={styles['nav-links']}>
                <div className={styles['nav-item']} style={{cursor: "pointer"}} onClick={() => window.location="/profile"}>
                    Home
                </div>
                <div className={styles['nav-item']}>
                    Contact
                </div>
                <div className={styles['nav-item']}>
                    Profile
                </div>

                <div className={styles['nav-item']} onClick={onLogout}>
                    Logout
                </div>
            </div>

            <div className={styles['nav-search']}>
                {/* <span> */}
                    <img src="https://img.icons8.com/ios-glyphs/20/null/search--v1.png"/>
                    <input type="text" placeholder="search" name="search" />
                {/* </span> */}
            </div>
        </div>
    )
}

export default Navbar;
